        <Container>
            <Row> <ul>
                {props.posts.map((element, index) =>
                    <li key={index}>
                        {element.title}
                    </li>
                )}
            </ul>
                <Col>
                    <ul>
                        <li>
                            <Card style={{ width: '18rem' }}>
                                <Card.Body>
                                    <Card.Title>hello</Card.Title>
                                    <Card.Text>
